import React from 'react';
import './App.css';
import HomePage from './components/HomePage';  // Correct import path
import CustomerOrders from './components/CustomerOrders';
import AdminOrderTable from './components/AdminOrderTable';
import Chart from './components/Chart';
import UserOrderDetails from './userOrderDetails';  // Correct import
import { createBrowserRouter, RouterProvider } from "react-router-dom";

const router = createBrowserRouter([
  { path: "/", element: <HomePage /> },
  { path: "/customerorder", element: <CustomerOrders /> },
  { path: "/userdetails", element: <UserOrderDetailsserOrderdetails /> },  // Corrected to PascalCase
  { path: "/adminorder", element: <AdminOrderTable /> },
  { path: "/chart", element: <Chart /> }
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
